 import React, {Component, Fragment} from 'react';
 import {
   HeaderWrapper,
   Logo,
   Nav
 } from './style';

 class Header extends Component {
   render() {
     return (
       <Fragment>
        <HeaderWrapper>
          <Logo/>

          <Nav>

          </Nav>
        </HeaderWrapper>
       </Fragment>
     )
   }
 }

 export default Header;
